import React from 'react';
import { Article } from '../types/nyt';

interface ItemListProps {
    articles: Article[];
    onSelect: (article: Article) => void;
}

const ItemList: React.FC<ItemListProps> = ({ articles, onSelect }) => {
    if (!articles.length) {
        return <div>No articles available</div>;
    }
    return (
        <div>
            <h2>Top Stories</h2>
            <ul>
                {articles.map(article => (
                    <li key={article.uri} onClick={() => onSelect(article)} style={{cursor: 'pointer'}}>
                        {article.multimedia && article.multimedia[0] && (
                            <img src={article.multimedia[0].url} alt={article.title} width={100} />
                        )}
                        <p>{article.title}</p>
                        <p>{article.byline}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default ItemList;
